Dans les sciences du vivant, l'espèce (du latin species, « type » ou « apparence ») est le taxon de base de la systématique. Il existe plus d'une vingtaine de définitions de l'espèce dans la littérature scientifique mais dans tous les cas l'espèce est un concept et non une réalité : la réalité biologique naturelle est celle des populations, et ce sont les observateurs humains qui en définissent les critères, les limites et la dénomination. La définition la plus communément admise est celle du concept biologique de l'espèce énoncé par Ernst Mayr en 1942 : une espèce est une population ou un ensemble de populations dont les individus peuvent effectivement ou potentiellement se reproduire entre eux et engendrer une descendance viable et féconde, dans des conditions naturelles. Ainsi, l'espèce est la plus grande unité de population au sein de laquelle le flux génétique est possible et les individus d'une même espèce sont donc génétiquement isolés d’autres ensembles équivalents du point de vue reproductif. Pourtant le critère d’interfécondité ne peut pas toujours être vérifié : c'est le cas pour les fossiles, les organismes asexués ou pour des espèces rares ou difficiles à observer. D’autres définitions peuvent donc être utilisées: 
*  espèce morphologique (morphospecies): groupe d'individus défini par des caractéristiques structurales (taille, forme…) ; 
*  espèce phylogénétique : la plus petite lignée d’une population pouvant être définie par une combinaison unique de caractères diagnostiques ; 
*  espèce écologique : groupe d’organismes partageant une même niche écologique ; 
*  espèce phénétique : ensemble d’organismes vivants se ressemblant (critères de similitudes morphologiques, anatomiques, embryologiques, etc.) plus entre eux qu’à d’autres ensembles équivalents.
